    'line-height': 1.75rem,
    'letter-spacing': .009375em
  ),
  'subtitle-2': (
    'size': .875rem,
    'weight': 500,
    'line-height': 1.375rem,
    'letter-spacing': .0071428571em
  ),
  'body-2': (
    'size': .875rem,
    'weight': 400,
    'letter-spacing': .0178571429em,
    'line-height': 1.25rem
  ),
  'body-1': (
    'size': 1rem,
    'weight': 400,
    'letter-spacing': .03125em,
